window.bookSummaryJSON = "<p><b>My teacher is trying to kill me....</b></p> <p>My mates and I are on the run while trying to figure out why our professor wants me dead. Not exactly the punishment I expected for botching an assignment.</p> <p>To get our happy end on a luxury resort planet, we may have to do the one thing I don't want my mates to do: abduct another alien.<br> When the abductee becomes the abductor, something is seriously wrong with the universe.</p> <p>The third and final part of Trish and her mates' story, a steamy reverse harem romance.</p> <p><b>If you want sexy aliens who will protect their mate at all cost, a sassy female who doesn't need protecting, plus every single alien abduction trope imaginable, scroll up and listen to this book today. Beware, you may be abducted at any moment, so don't waste time.</b></p>"; 
